def t_STRING_DOUBLE(t):
    r'\"\"|\"([^\"]+|\"{2,})+\"'
    t.lexer.lineno += t.value.count('\n')
    return t


def t_STRING_SINGLE(t):
    r"''|'([^']+|'{2,})+'"
    t.lexer.lineno += t.value.count('\n')
    return t


def t_COMMENT_SINGLE(t):
    r'//.*[\n\r]?'
    t.lexer.lineno += 1


def t_COMMENT_MULTI(t):
    r'/\*[\w\W]*?\*/'
    t.lexer.lineno += t.value.count('\n')


def t_PRIVATE_ID(t):
    r'_[a-zA-Z_0-9]*'
    t.type = reserved.get(t.value.lower(), 'PRIVATE_ID')
    return t


def t_GLOBAL_ID(t):
    r'[a-zA-Z_][a-zA-Z_0-9]*'
    if t.value.lower() in ["uinamespace", "missionnamespace", "parsingnamespace", "profilenamespace"]:
        t.type = 'NAMESPACE'
    elif t.value.lower() in unary_functions:
        t.type = 'UNARY_FNC'
    elif t.value.lower() in binary_functions:
        t.type = 'BINARY_FNC'
    elif t.value.lower() in nular_functions:
        t.type = 'NULAR_FNC'
    else:
        t.type = reserved.get(t.value.lower(), 'GLOBAL_ID')
    return t


def t_NUMBER_EXP(t):
    r'([0-9]+\.)?[0-9]+[eE][-+]?[0-9]+'
    t.value = float(t.value)
    return t


def t_NUMBER_HEX(t):
    r'(\$|0x)[0-9a-fA-F]+'
    t.value = t.value.replace('$', '0x')
    t.value = int(t.value, base=16)
    return t


def t_NUMBER_REAL(t):
    r'\d*\.?\d+'
    t.value = float(t.value) if any([x in t.value for x in ['.', 'e', 'nan']]) else int(t.value)
    return t


def t_NEWLINE(t):
    r'\n+'
    t.lexer.lineno += len(t.value)


